import React from "react";

import styled from "styled-components";
import Skillheader from "../04 Organisms/skillpage/skillheader";
import {colorsRoles} from "../01 Atoms/Colors";
import {media} from "../01 Atoms/MediaQueries";

import {images} from "../01 Atoms/Images";
import TemplateMethodo from "../04 Organisms/skillpage/TemplateMethodo";
import NavProjects from "../04 Organisms/navproject/NavProjects";
import {ClientsUXUI} from "../01 Atoms/Data";

export const Box = styled.div`
position: relative;
${media.desktop`
margin-right: 80px;
`
}
`;


const UxUiProjects = () => {
    return <>

        <Box>
            <Skillheader
                mainTitle={"UX/UI Designer"}
                mainColor={colorsRoles.Brand01}
                srcMainImg={images.Parrot}
                description={"I'm primarily concerned with how the product feels. By identifying verbal and non-verbal stumbling blocks, I refine and iterate to create the “best” user experience. "}
                Flipped={false}
                ClientsUXUI/>
            <TemplateMethodo
                isuiuxdesigner
            />
            <NavProjects/>
        </Box>

    </>

};


export default UxUiProjects;
